{ وَهُدُوا إلى الطَّيِّبِ مِنَ الْقَوْل }

اللهم أحطني بمَن هديتهم إلى الطيّب من القَول، الذين لا تخرج منهم كلمة تثبّطني، الذين يحرصون على انتقاء كلماتهم وتمحيصها بعناية خوفًا من خروج كلمة طائشة يُخدَش بها قلبي.

اللهم إني زاهدٌ بالناس جميعًا، ولا أرغب إلا بهذا النوع من العلاقات.
